The Undertones are a punk rock/power pop band formed in Derry, Northern Ireland in 1975.

The original line-up released four studio albums?The Undertones (1979), Hypnotised (1980), Positive Touch (1981) and The Sin Of Pride (1983)?before disbanding in 1983. All Music Guide stated that guitarists John and Damian O&amp;#039;Neill &quot;mated infectious guitar hooks to &amp;#039;60s garage, &amp;#039;70s glam rock, and Feargal Sharkey&amp;#039;s signature vocal quaver.&quot;Salon.com stated that &quot;When they began, they were a bunch of teenage Ramones-heads, and the only punk band in Ireland.&quot;




